SELECT DISTINCT ?team
WHERE {
  # Step 1: Identify Marty Pollio's birthdate
  VALUES ?martyBirthDate { 
    SELECT ?birthdate WHERE { 
      dbr:Marty_Pollio dbo:birthDate ?birthdate .
    }
  }

  # Step 2: Find athletes born on this date and their teams
  ?athlete dbo:birthDate ?martyBirthDate ;
           dbo:team ?team1 .

  # Step 3: Identify actors from "All or Nothing: Manchester City" who are soccer players and athletes, and find their teams
  dbr:All_or_Nothing:_Manchester_City dbo:starring ?actor .
  ?actor a dbo:Athlete ;
         a dbo:SoccerPlayer ;
         dbo:team ?team2 .

  # Step 4: Find the person born on 1979-11-03 who is both a soccer player and manager, and determine their team
  VALUES ?targetBirthDate { "1979-11-03"^^xsd:date }
  ?person dbo:birthDate ?targetBirthDate ;
          a dbo:SoccerPlayer ;
          a dbo:SoccerManager ;
          dbo:team ?team3 .

  # Step 5: Ensure the team satisfies all conditions
  FILTER (?team1 = ?team2 && ?team1 = ?team3)
}
